import React from 'react';
import './App.css';
import './bootstrap.min.css';

class App extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			view : []
		}
	}
	render(){
		return (
	    <div class="container_fluid">
			<nav class="navbar navbar-light bg-light header_shadow w-100">
			  	<a class="navbar-brand" href="#">Navbar</a>
			</nav>
			<div id="mdm-cart"></div>
		</div>
	  );
	}	
}
